import { useEffect, useState } from "react";

const[cart,setCart]=useState([])
useEffect(()=>{
    fetch("http://localhost:3006/Data")
    .then((res)=>{
        return res.json
    }).then((resp)=>{
        setCart(resp)
    })
})
function Cart(){
    return(
        <div>
            <h1></h1>
<table>
    <thead>
        <tr>
            <th>Id</th>
            <th>Name</th>
            <th>Cost</th>
            <th>Actions</th>
        </tr>
    </thead>
<tbody>
    {cart.map((i)=>(
        <tr>
            <td>{i.id}</td>
            <td>{i.name}</td>
            <td>{i.cost}</td>
            <td><a className="btn btn-danger">Remove</a></td>
        </tr>
    ))}
</tbody>
</table>
        </div>
    )
}
export default Cart;
